import React from "react";
import MovieDetails from "./components/MovieDetails.jsx";
import "./style/movie.css";

function App() {
  const favoriteMovies = [
    {
      title: "Inception",
      director: "Christopher Nolan",
      year: 2010,
      studio: "Warner Bros.",
      poster:
        "https://image.tmdb.org/t/p/original/6oom5QYQ2yQTMJIbnvbkBL9cHo6.jpg",
    },

    {
      title: "The Shawshank Redemption",
      director: "Frank Darabont",
      year: 1994,
      studio: "Columbia Pictures",
      poster:
        "https://artofthemovies.co.uk/cdn/shop/products/lord_of_the_rings_the_two_towers_NG06275_B-159226.jpg?v=1611688137",
    },
    ,
    {
      title: "The Shawshank Redemption",
      director: "Frank Darabont",
      year: 1994,
      studio: "Columbia Pictures",
      poster:
        "https://cs14.pikabu.ru/post_img/big/2023/04/27/6/1682582758210995834.png",
    },
  ];

  return (
    <div className="movie">
      {favoriteMovies.map((movie, index) => (
        <MovieDetails key={index} movie={movie} />
      ))}
    </div>
  );
}

export default App;
